import './App.css';
import logo from './assets/barber-shop-icon-vector-illustration-design-logo-barber-shop-icon-vector-illustration-design-logo-template-decorative-traditional-159225753.jpeg'
import 'bootstrap/dist/css/bootstrap.css';
import {Nav,Navbar} from 'react-bootstrap'
function App() {
  return (
    <div className="App">
      <Navbar bg="header" variant ="dark">
      <Navbar.Brand>

      Baber
      </Navbar.Brand>


      <Nav>
      <Nav.Link href="#">Lifestyle</Nav.Link>
      <Nav.Link href="#">Product</Nav.Link>
      <Nav.Link href="#">Booking</Nav.Link>
      <Nav.Link href="#">Store</Nav.Link>

      </Nav>
      </Navbar>
    </div>
  );
}

export default App;
